textfsm_template:
Value ADJACENCY_ID (\d+)
Value SOURCE_INTERFACE (\S+)
Value DESTINATION_INTERFACE (\S+)
Value ADJACENCY_TYPE (\S+)
Value ADJACENCY_STATE (\S+,\s\S+)
Value NEXT_HOP (\S+)

Start
  ^Forwarding\sadjacency\s\(adjacency-id\s${ADJACENCY_ID}\)
  ^\s*Source\sInterface:\s${SOURCE_INTERFACE}
  ^\s*Destination\sInterface:\s${DESTINATION_INTERFACE}
  ^\s*Adjacency\sType:\s${ADJACENCY_TYPE}
  ^\s*Adjacency\sState:\s${ADJACENCY_STATE}
  ^\s*Next\sHop\sAddress:\s${NEXT_HOP}\s*$$ -> Record
